import React from "react"
import "./home.css"


const Home = () => {

  function setup(e) {
    alert('You clicked setup.');
  }

  function requestMeeting(e) {
    alert('You clicked request.');
  }

  return (

    <>
      <section className='hero'>
        <div>

          <h2>Welcome Arya to TOPY Station</h2>
        <div>
          <button class="b1" onClick={setup}>Setup Meeting</button>
          <button class="b2" onClick={requestMeeting}>Incoming Request</button>
          <img src={require('../../public/old.jpg')} width="100" height="100" alt="hello"></img>
        </div>
        </div>


      </section>
    </>
  )
}
export default Home
